import React from 'react';
import web from '../src/images/m1.jpg';
import {NavLink} from 'react-router-dom';
import Common from './Common';
const Home = () => {
    return ( 
      <>
         
          <Common name=" Build your business with "
          imgsrc={web}
          visit="/service"
          btnname="Get started"/>
  </>
  
    );
  }
  
  export default Home;
